    <link rel="preconnect" href="https://fonts.googleapis.com">

<link href="https://fonts.googleapis.com/css2?family=Poppins&display=swap" rel="stylesheet">
    <title>Card</title>
    <style>
        *{
            font-family: 'Poppins', sans-serif;
        }
        p{
            padding: 0;
            margin: 0;
        }
        .col-5-5 {
    flex: 0 0 auto;
    width: 47%;
}
        .container-fluid {
            width: 440px !important;
            max-height: 650px !important;
        }
        .container-fluid .with{
            width: 440px !important;
            max-height: 650px !important;
        }

        .description .head {
                
            font-style: normal;
            font-weight: 600;
            font-size: 12px;
            line-height: 16px;
            color: #3a3a3a;

        }

        .description .des {
            font-style: normal;
            font-weight: normal;
            font-size: 9px;
            line-height: 15px;
            color: #4e5458;
        }

        .company_name {
            font-style: normal;
            font-weight: bolder;
            font-size: 16px;
            color: #081F32;
        }


        .price {
            font-style: normal;
            font-weight: normal;
            font-size: 28px;
            line-height: 25px;
        }

       

        
        .price button {background-image: linear-gradient(to right, #93EDC7 0%, #1ab6b1  80%, #93EDC7  100%)}
        .price button  {
            width: 100%;
            font-size: 18px;
            padding: 15px 45px;
            text-align: center;
            text-transform: uppercase;
            transition: 0.5s;
            background-size: 200% auto;
            color: white;            
            box-shadow: 0 0 20px #eee;
            border-radius: 10px;
            display: block;
            outline: none;
            border: none;
          }

     
         
        .additionalNote {
            align-self: center;
        }

        .additionalNote .head {
            font-family: 'Open Sans', sans-serif;
            font-style: normal;
            font-weight: 600;
            font-size: 16px;
            line-height: 16px;
            color: #AD4328;
        }

        .additionalNote .des {
            font-family: 'Open Sans', sans-serif;
            font-weight: normal;
            font-size: 14px;
            line-height: 21px;
            color: #374A59;
            font-style: italic;
        }
    </style>
</head>

<body>
    <div class="container-fluid" >
        <div class="row with" style="width: 100%; 
            padding: 10px 10px;
        ">
            
            <div class="col-7 row info ">
                <div >

                    <div class="company_name mb-2" style="text-align: center; line-height: 40px;">
                        {company_name}
                    </div>

                    <div class="description mt-1 ">
                        <div class="head mb-1" style="text-align: center;">
                            Date interm
                        </div>
                        <div class="des">
                            <p style="text-align: center;">
                                {date}
                            </p>
                        </div>
                    </div>
                    <div class="description mt-2" style=" display: flex; flex-direction: column; align-items: center; justify-content: center;  min-height: 220.656px;">
                        <div class="head mb-1 " style="text-align: center;">
                            Description
                        </div>
                        <div class="des" style="word-wrap: break-word; hyphens:auto; text-align: center;">
                            {description}
                        </div>
                    </div>
                 
                </div>
                <div class="price mt-2">
                    <button> {price} AZN</button>
                </div>
                <div class="description mt-2">
                    <div class="head mb-2" style="text-align: center;">
                        Notes 
                    </div>
                    <div class="des" style="color: rgba(216, 52, 52,0.8);">
                        <p style="  text-align: center;">
                            {notes}
                        </p>
                    </div>
                </div>
              
               
            </div>
